import React from "react";
import S from "./style"; // styled-components로 스타일링했다고 가정
import Logo from "./Logo";
import Notification from "./Notification";
import UserProfile from "./UserProfile";
import BasicButton from "../../button/BasicButton";

const Header = ({ isLoggedIn, user }) => {
    return (
        <S.HeaderWrapper>
            <Logo />

            <S.NavMenu>
                {isLoggedIn ? (
                    <>
                        <span>친구들 보러가기</span>
                        <span>FAQ</span>
                        <span>멍게시판</span>
                    </>
                ) : (
                    <>
                        <span>FAQ</span>
                        <span>이용후기</span>
                    </>
                )}
            </S.NavMenu>

            <S.RightMenu>
                {isLoggedIn ? (
                    <>
                        <Notification count={2} />
                        <img src="/icon/send.svg" alt="send" />
                        <img src="/icon/calendar.svg" alt="calendar" />
                        <UserProfile src={user?.profileImage} />
                    </>
                ) : (
                    <>
                        <BasicButton roundButton="small" variant="filled">로그인</BasicButton>
                        <BasicButton roundButton="small" variant="filled">회원가입</BasicButton>
                    </>
                )}
            </S.RightMenu>
        </S.HeaderWrapper>
    );
};

export default Header;
